import React, {Component} from 'react';
import {Nav, Navbar} from 'react-bootstrap';
import '../css/NavBar.css';
import LogoutButton from './LogoutButton.js';

class TunaNavBar extends Component {

    render() {
        return(
            <Navbar className="container-fluid" bg="dark" variant="dark" expand="lg">
                <Navbar.Brand href="#home" onClick={this.props.goHome}>Tuna</Navbar.Brand>
                    <Nav className="mr-auto">
                        <Nav.Link onClick={this.props.goCharlie}>Charlie Formula</Nav.Link>
                        <Nav.Link onClick={this.props.goTimes}>Tuna Times</Nav.Link>
                        <Nav.Link onClick={this.props.goMembers}>Members</Nav.Link>
                        <LogoutButton/>
                    </Nav>
            </Navbar>
        )
    }
}

export default TunaNavBar;
